import React from 'react';

function TodoList(props) {
  return (
    <div>
        <table>
            <tbody>
                {props.list.map(item => {
                    return (
                        <tr>
                            <td>
                                {item}
                            </td>
                        </tr>   
                )})}
            </tbody>
        </table>
    </div>
  );
}

export default TodoList;
